import * as React from "react";
import Button from "@mui/material/Button";
import Modal from "@mui/material/Modal";
import { AdminModalProps } from "../../types/pages/AdminModalProps";
import {
  Table,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";
import styles from "./scss/AdminModal.module.scss";
export const AdminModal: React.FC<AdminModalProps> = (props) => {
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  return (
    <div>
      <Button onClick={handleOpen}>Open modal</Button>
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
        className={styles.modal}
      >
        <TableContainer>
          <Table>
            <TableHead>
              {props.qStat.questionnaireResponses.map((qNairRes) => (
                <TableRow>
                  {qNairRes.questionResponses.map((qResponse) => (
                    <>
                      <TableCell>Q:</TableCell>
                      <TableCell>A:{qResponse.getAnswer()}</TableCell>
                    </>
                  ))}
                </TableRow>
              ))}
              <TableRow>
                <TableCell>{`${props.qStat.userId}`}</TableCell>
                <TableCell>{`${props.qStat.count}`}</TableCell>
              </TableRow>
            </TableHead>
          </Table>
        </TableContainer>
      </Modal>
    </div>
  );
};
